Accounts_CustomFields_Description:
Jābūt derīgam JSON, kur taustiņi ir lauku nosaukumi, kuros ir lauku iestatījumu vārdnīca. Piemērs: <br / ><code>{
"loma": {
"tips": "izvēlēties"
"defaultValue": "students"
"iespējas": ["skolotājs", "students"],
"nepieciešams": patiess
"modifyRecordField": {
"masīvs": patiess
"lauks": "lomas"
}
},
"twitter": {
"tips": "teksts",
"nepieciešams": patiess
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Jābūt derīgam JSON, kur taustiņi ir valodas, kurās ir atslēgas vārdnīca un tulkojumi. Piemērs: <br / ><code>{
"en": {
"Kanāli": "Istabas"
},
"pt": {
"Kanāli": "Salas"
}
}</code>
